import AllEpisodes from "./components/AllEpisodes";
import episodeData from "./ShowData.json";

function App() {
  return <AllEpisodes 
          name={episodeData[0].name}
          season={episodeData[0].season}
          number={episodeData[0].number}
          image={episodeData[0].image.medium}
          summary={episodeData[0].summary}
          />;
}

export default App;
